const ICON_BY_FACTION = {
  rebel: RebelIcon,
  resistance: RebelIcon,
  republic: RebelIcon,
  jedi: RebelIcon,
  light: RebelIcon,
  empire: EmpireIcon,
  imperial: EmpireIcon,
  sith: EmpireIcon,
  dark: EmpireIcon,
  firstorder: EmpireIcon,
  'first order': EmpireIcon
};

const normalize = (s) =>
  s
    ? String(s)
        .trim()
        .toLowerCase()
        .replace(/[\s_-]+/g, '')
    : '';

export function iconByFaction(faction) {
  const raw = (s) => ICON_BY_FACTION[s] || ICON_BY_FACTION[normalize(s)];
  return (raw(faction) || RebelIcon)();
}

export function iconTemplateFor(character) {
  return iconByFaction(character?.faction);
}
